-US\" style=\"mso-ansi-language: EN-US;\">Ultrafiltration is a modern membrane separation process that removes all suspended solids, colloids and most of bacteria and viruses from water. UF membrane works as a physical barrier to particles larger than certain pore size of the membrane. Typically, membrane is considered as ultrafiltration if the nominal pore is smaller than 0.1 </span><span lang=\"EN-US\" style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-ansi-language: EN-US;\">&micro;</span><span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">m. There are several materials used for UF membranes, but the most widely used materials are organic polymers as PES and PVDF. In recent years the PVDF material is taking over the dominant position in the market. This is because UF membranes made of PVDF, especially when made by TIPS technology, provides great chemical and mechanical strength.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"EN-GB\">Ultrafiltration is an alternative to conventional treatment technologies e.g. </span><span lang=\"EN-US\">sand and media filtrations. When compared to conventional technologies, ultrafiltration brings added value of excellent produced water quality, high water recovery ratio, robustness and small footprint. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"EN-US\">For example, use of ultrafiltration for drinking water production provides great bacteria and virus removal reducing the consumption of disinfection chemicals. Use of ultrafiltration as RO/NF pretreatment step significantly reduces fouling rate of the RO/NF membranes. So, the RO/NF system can be designed to work with higher average flux and requires less frequent cleaning.&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>',_binary 'ÿ\Øÿ\à\0JFIF\0\0`\0`\0\0ÿ\Û\0C\0		